import { Component } from "react";
import "./Register.css"
import { Constants } from "../../Constants"

class Register extends Component {

    state = {
        users: [],
        user: {
            firstName: '',
            lastName: '',
            address: '',
            email: '',
            password: ''
        }
    }

    constructor() {
        super();
        this.state.users = localStorage.getItem(Constants.USER);
    }


    onRegister = () => {

    }

    onTextChange = (value, type) => {
        switch (value) {
            case Constants.FIRST_NAME: {
                this.state.user = { firstName: value }
            }
        }

    }

    render() {
        return (
            <div className="register-page-container">
                <p>First Name:</p>
                <input type="text"></input>

                <p className="title-style">Last Name:</p>
                <input type="text"></input>

                <p className="title-style">Address:</p>
                <input type="text"></input>

                <p className="title-style">Email:</p>
                <input type="text"></input>

                <p className="title-style" >Password:</p>
                <input type="text"></input>
                <button className="btn-register">Register</button>
            </div>
        );
    }
}

export default Register;
